import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { IoEyeOutline, IoChevronDown } from 'react-icons/io5';

const Portfolio = () => {
  const [activeFilter, setActiveFilter] = useState('all');
  const [showSelect, setShowSelect] = useState(false);

  const filters = [
    { id: 'all', label: 'All' },
    { id: 'web development', label: 'Web development' }
  ];

  const projects = [
    {
      id: 1,
      title: 'Job-Listing Portal',
      category: 'web development',
      image: '/assets/images/project-1.png',
      technologies: 'HTML, CSS, JavaScript, React, MongoDb, Nodejs, ExpressJs',
      link: '#'
    },
    {
      id: 2,
      title: 'Gym Website',
      category: 'web development',
      image: '/assets/images/project-2.png',
      technologies: 'HTML, CSS, React, JavaScript',
      link: 'https://fitzonebytusharjain.vercel.app/'
    },
    {
      id: 3,
      title: 'Inventory Management System',
      category: 'web design',
      image: '/assets/images/project-3.jpeg',
      technologies: 'HTML, CSS, JavaScript',
      link: '#'
    },
    {
      id: 4,
      title: 'TextUtils',
      category: 'applications',
      image: '/assets/images/project-4.png',
      technologies: 'HTML, CSS, JavaScript, React',
      link: '#'
    },
    {
      id: 5,
      title: 'Resume Builder',
      category: 'web development',
      image: '/assets/images/project-9.png',
      technologies: 'React, JavaScript, CSS, Vercel',
      link: 'https://resume-builder-git-main-tushar-jains-projects-e9d20105.vercel.app/'
    }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
      className="max-w-6xl mx-auto"
    >
      <header className="mb-8">
        <h2 className="text-3xl font-fw-600 text-white-1 article-title">
          Portfolio
        </h2>
      </header>

      <section>
        {/* Filter Buttons - Desktop */}
        <div className="hidden md:flex mb-8">
          <ul className="flex space-x-4">
            {filters.map((filter) => (
              <li key={filter.id}>
                <button
                  onClick={() => setActiveFilter(filter.id)}
                  className={`
                    px-4 py-2 rounded-lg text-fs-5 font-fw-500 transition-all duration-200
                    ${activeFilter === filter.id
                      ? 'bg-orange-yellow text-black'
                      : 'bg-eerie-black-1 text-light-gray hover:text-white-1 hover:bg-jet'
                    }
                  `}
                >
                  {filter.label}
                </button>
              </li>
            ))}
          </ul>
        </div>

        {/* Filter Select - Mobile */}
        <div className="md:hidden mb-8 relative">
          <button
            onClick={() => setShowSelect(!showSelect)}
            className="w-full flex items-center justify-between p-3 bg-eerie-black-1 rounded-lg border border-light-gray-70"
          >
            <span className="text-fs-5 text-white-1">
              {filters.find(f => f.id === activeFilter)?.label || 'Select category'}
            </span>
            <IoChevronDown className={`text-light-gray transition-transform ${showSelect ? 'rotate-180' : ''}`} />
          </button>

          {showSelect && (
            <div className="absolute top-full left-0 right-0 mt-2 bg-eerie-black-1 border border-light-gray-70 rounded-lg z-10">
              {filters.map((filter) => (
                <button
                  key={filter.id}
                  onClick={() => {
                    setActiveFilter(filter.id);
                    setShowSelect(false);
                  }}
                  className="w-full text-left p-3 text-fs-5 text-light-gray hover:text-white-1 hover:bg-jet transition-colors"
                >
                  {filter.label}
                </button>
              ))}
            </div>
          )}
        </div>

        {/* Projects Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          <AnimatePresence mode="wait">
            {filteredProjects.map((project, index) => (
              <motion.div
                key={project.id}
                initial={{ opacity: 0, scale: 0.8 }}
                animate={{ opacity: 1, scale: 1 }}
                exit={{ opacity: 0, scale: 0.8 }}
                transition={{ duration: 0.3, delay: index * 0.1 }}
                className="project-item group"
              >
                <a href={project.link} target="_blank" rel="noopener noreferrer" className="block">
                  <div className="relative overflow-hidden rounded-lg bg-eerie-black-1">
                    <img
                      src={project.image}
                      alt={project.title}
                      className="w-full h-48 object-cover transition-transform duration-300 group-hover:scale-110"
                    />
                    
                    <div className="project-img-overlay">
                      <div className="w-12 h-12 bg-orange-yellow rounded-lg flex items-center justify-center">
                        <IoEyeOutline className="text-black text-xl" />
                      </div>
                    </div>
                  </div>

                  <div className="mt-4">
                    <h3 className="text-lg font-fw-600 text-white-1 mb-2 group-hover:text-orange-yellow transition-colors">
                      {project.title}
                    </h3>
                    <p className="text-fs-5 text-light-gray">
                      {project.technologies}
                    </p>
                    {project.link !== '#' && (
                      <span className="inline-block mt-2 text-orange-yellow text-fs-6">
                        Visit Project
                      </span>
                    )}
                  </div>
                </a>
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      </section>
    </motion.div>
  );
};

export default Portfolio;
